INSERT INTO `conditions` VALUES (1,'<p><img alt=\"\" src=\"http://saaloon.com/public/web/img/line.png\" /></p>\r\n\r\n<p>الشروط والأحكام</p>\r\n\r\n<p>المحتوى</p>\r\n\r\n<p>قواعد الممارسات الصحيحة</p>\r\n\r\n<p>مقدمة الشروط والأحكام</p>\r\n\r\n<p>الشروط والأحكام:</p>\r\n\r\n<p>تعريفات</p>\r\n\r\n<p>نطاق وطبيعة خدمتنا</p>\r\n\r\n<p>الأسعار، والأسعار المشطوبة، ومضاهاة الأسعار</p>\r\n\r\n<p>الخصوصية وملفات تعريف الارتباط</p>\r\n\r\n<p>مجاناً للمستهلكين، مقدمي الخدمات من يتكفلون بالدفع فقط&nbsp;</p>\r\n\r\n<p>بطاقة الائتمان أو التحويل البنكي</p>\r\n\r\n<p>الدفعة المسبقة، والإلغاء، وعدم الحضور، والشروط المفصلة</p>\r\n\r\n<p>(للمزيد من) التواصل والمراسلات</p>\r\n\r\n<p>التصنيف والبرنامج المفضل وآراء النزلاء</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>حقوق الملكية الفكرية</p>\r\n\r\n<p>القوانين المطبقة والولاية القضائية وتسوية النزاعات</p>\r\n\r\n<p>عن&nbsp;<a href=\"http://saaloon.com/\"><strong>saaloon.com</strong></a>&nbsp;والشركات الداعمة</p>\r\n\r\n<p>قواعد الممارسات الصحيحة</p>\r\n\r\n<p><strong>مهمتنا أن نفتح لك آفاقاً جديدة العالم من حولك وذلك من خلال تقديم أفضل المشاغل والصالونات لتتمتع بزيارتها بالطريقة الأمثل، ولتحقيق هذا الهدف سنتبع الممارسات التالية:</strong></p>\r\n\r\n<ul>\r\n	<li><strong>نهتم لأمرك: فنحن نوفر منصتنا وخدمة عملائنا بالطريقة الأسهل والأنسب لكم</strong></li>\r\n	<li><strong>نفتح لك الباب أمام التجارب: حيث نقدم لك أكثر مشغل وصالون &nbsp;من الأكثر فخامة إلى الأماكن التي تناسب مختلف احتياجاتك.</strong></li>\r\n	<li><strong>نقدم لك فرصة تجربة مختلف الخدمات المقدمة بشكل سريع وسهل</strong></li>\r\n	<li><strong>نسهل لك عملية الدفع مقابل رسوم الخدمات المقدمة</strong></li>\r\n	<li><strong>خدماتنا متوفرة على مدار (24/7): مراكز خدمات عملائنا متوفرة لمساعدتك على مدار الساعة، سبعة أيام في الأسبوع .</strong></li>\r\n	<li><strong>رأيك يهمنا: يتم إنشاء منصاتنا بحسب ما تفضله (كمستخدم) وبالشكل الأنسب لك عند استخدام خدماتنا</strong></li>\r\n	<li><strong>صوتك يصلنا: فنحن نعرض التقييمات من دون مراقبة (تقييمات الضيوف الذي أقاموا بشكل فعلي)</strong></li>\r\n	<li><strong>نعدك بموقع إلكتروني غني بالمعلومات، وسهل الاستخدام يضمن لك أفضل الأسعار المتوفرة.</strong></li>\r\n	<li><strong>نحن نضاهي الأسعار</strong></li>\r\n</ul>\r\n\r\n<p>مقدمة الشروط والأحكام</p>\r\n\r\n<p><strong>يمكن لهذه الشروط والأحكام أن تعدل من وقت لآخر، وهي تنطبق بشكل مباشر أو غير مباشر (عن طريق الموزعين) على جميع خدماتنا المتاحة على شبكة الإنترنت أو من خلال أي جهاز محمول ومن خلال البريد الإلكتروني والهاتف. بدخولكم وتصفحكم واستخدامكم لموقعنا (موقع الهاتف المحمول) أو أي من تطبيقاتنا من خلال أي منصة (والمشار إليها مجتمعة باسم &quot;المنصة&quot;)، و/ أو من خلال استكمال الحجز، فإنكم تقرّون وتوافقون على أنكم قد قرأتم وفهمتم ووافقتم على الشروط والأحكام المبيّنة أدناه (بما في ذلك بيان الخصوصية).</strong></p>\r\n\r\n<p><strong>هذه الصفحات، ومحتواها، والبنية التحتية لها، وخدمة الحجز عبر الإنترنت (بما في ذلك تسهيل خدمة الدفع) المقدمة من خلالها ومن خلال الموقع هي مملوكة ومشغلة ومقدمة من قِبل</strong><a href=\"http://saaloon.com/\">saaloon.com</a><strong>&nbsp;وهي مقدّمة لاستخدامكم الشخصي غير التجاري فقط، وتخضع للشروط والأحكام المذكورة أدناه. إن العلاقة التي لدينا مع مقدمي خدمات العانية بالبشرة والتجميل تخضع لشروط وأحكام منفصلة تتحكم بالعلاقة التجارية (</strong>B2B<strong>) التي لدينا مع كل من مقدمي خدمات العانية بالبشرة والتجميل. يحرص كل مقدم خدمات العانية بالبشرة والتجميل على العمل بطريقة احترافية مع</strong><a href=\"http://saaloon.com/\">saaloon.com</a><strong>&nbsp;عند تقديم منتجاته و / أو خدمته من خلال&nbsp;</strong><a href=\"http://saaloon.com/\">saaloon.com</a><strong>&nbsp;(سواء إن كان منتجه أو خدمته مقدمة إلى عمل تجاري (&quot;</strong>B2B<strong>&quot;) و / أو مستهلك (&quot;</strong>B2C<strong>&quot;). يرجى ملاحظة أن مقدمي خدمات العانية بالبشرة والتجميل قد يكونوا قد أعلنوا عن تطبيق و / أو طلب (قبول) - بالإضافة إلى السياسات والشروط المفصلة على النحو المبين في الموقع، وشروطهم الخاصة (التسليم / الشحن / النقل / الاستخدام) والقواعد الداخلية الخاصة باستخدام خدمات العانية بالبشرة والتجميل والوصول إليها وإتمامها (والتي قد تتضمن إخلاء أو تعيين حدود لبعض المسؤوليات).</strong></p>\r\n\r\n<p>تعريفات</p>\r\n\r\n<p><strong>&quot;</strong>&nbsp;&nbsp;&quot;<a href=\"http://saaloon.com/saaloon.com\">saaloon.com</a><strong>&nbsp;أو &quot;نحن&quot; أو &quot;لنا&quot; &quot;المنصة&quot; تعني موقع الويب وعبر الهاتف المحمول والتطبيق، الذي يتوفر من خلاله خدمة تقديم الرحلات وتكون من ملك، تحت تحكم، إدارة، صيانة، و / أو مضافة من قبل&nbsp;</strong><a href=\"http://saaloon.com/saaloon.com\">saaloon.com</a><strong>&quot; خدمات العانية بالبشرة والتجميل&quot; تعني مختلف منتجات وخدمات العناية بالبشرة والتجميل والعناية بالشعر ومواد المكياج &nbsp;التي يمكن طلبها أو الحصول عليها أو شرائها أو دفع ثمنها أو تأجيرها أو توفيرها أو حجزها أو دمجها أو الحصول عليها عبر مقدم خدمات العانية بالبشرة والتجميل.</strong></p>\r\n\r\n<p><strong>&quot; مقدم خدمات العانية بالبشرة والتجميل &quot; يعني الموفر المهني لخدمات العانية بالبشرة والتجميل (مثل المشاغل، والصالونات، ومراكز التجميل، والعناية بالبشرة، مواد المكياج)، أو المنتجات أو الخدمات ذات الصلة من وقت لآخر بحجز خدمات العانية بالبشرة والتجميل على منصة (سواء&nbsp;</strong>B2B<strong>&nbsp;أو&nbsp;</strong>B2C<strong>).</strong></p>\r\n\r\n<p><strong>&quot; خدمات العانية بالبشرة والتجميل &quot; تعني خدمة الدفع أو الحجز عبر الإنترنت (التي تسهل) الدفع أو الحجز التي يقدمها أو تم تمكينها من قبل&nbsp;</strong><a href=\"http://saaloon.com/saaloon.com\">saaloon.com</a><strong>&nbsp;فيما يتعلق بمختلف المنتجات والخدمات التي يوفرها مقدمي خدمات العانية بالبشرة والتجميل على المنصة من وقت لآخر.</strong></p>\r\n\r\n<p><strong>&quot;حجز خدمات العانية بالبشرة والتجميل &quot; يعني الطلب، أو الشراء، أو الدفع، أو الحجز لخدمة معينة.</strong></p>\r\n\r\n<p><strong>1.&nbsp;</strong>نطاق وطبيعة خدمتنا</p>\r\n\r\n<p><strong>من خلال المنصة، نحن (</strong><a href=\"http://saaloon.com/saaloon.com\">saaloon.com</a><strong>&nbsp;والشركاء (الموزعين) التابعين) يتم توفير منصة على الإنترنت تمكن مقدمي الرحلات - في ضمن مجالهم المهني (أي&nbsp;</strong>B2C<strong>&nbsp;أو&nbsp;</strong>B2B<strong>) - من الإعلان، التسويق، البيع، التعزيز و / أو تقديم المنتجات والخدمات (حسب الإمكانية) للطلب والشراء والحجز والاستئجار، ومن خلالها يمكن للزوار المعنيين للمنصة اكتشاف أو البحث أو المقارنة أو عمل طلب أو الحجز أو الشراء أو الدفع (مثل خدمات التجميل).</strong></p>\r\n\r\n<p><strong>&nbsp;إن استخدام خدمة العانية بالبشرة والتجميلمنها (على سبيل المثال: حجز خدمات العانية بالبشرة والتجميل)، فإنك تدخل في علاقة مباشرة (ملزمة قانونياً) مع مقدم خدمات العانية بالبشرة والتجميل الذي يقوم بالحجز أو شراء منتج أو تقديم خدمة (حسب الإمكانية). من النقطة التي تجري فيها حجز خدمتك، نتصرف فقط كوسيط بينك وبين مقدم الخدمة، ونرسل التفاصيل ذات الصلة بحجز خدمتك إلى مقدمي خدمات العانية بالبشرة والتجميل ذات صلة، ونرسل إليك رسالة تأكيد بالبريد الإلكتروني نيابة عن مقدم الخدمة. لا تقوم (</strong><a href=\"http://saaloon.com/saaloon.com\">saaloon.com</a><strong>) ببيع أو تأجير أو عرض أي منتج أو خدمة (تجميل وعناية بالبشرة).</strong></p>\r\n\r\n<p><strong>عند تقديم خدمة العانية بالبشرة والتجميل، فإن المعلومات التي نكشف عنها تستند على المعلومات المقدمة لنا من قبل مقدمي خدمات العانية بالبشرة والتجميل. على هذا النحو، مقدمو خدمات العانية بالبشرة والتجميل الذين يقومون بالتسويق وعرض منتجاتهم على منصة، يتم منحهم إذن الدخول إلى أنظمتنا والإكسترانت ومن خلال ذلك هم المسؤولون بشكل كامل عن تحديث جميع الأسعار / الرسوم، والتوافر، والسياسات والشروط وغيرها من المعلومات ذات الصلة التي يتم عرضها على المنصة لدينا. على الرغم من أننا سنستخدم مهاراتنا وعنايتنا في أداء إجراءات خدمة خدمات العانية بالبشرة والتجميل لدينا، لكننا لن نقوم بالتحقق، ولا يمكننا أن نضمن جميع المعلومات إن كانت دقيقة أو كاملة أو صحيحة، ولا يمكن أن نكون مسؤولين عن أي أخطاء (بما في ذلك أخطاء بيانية ومطبعية)، أيضاً لسنا مسؤولون عن أي انقطاع (سواء كان ذلك بسبب أي انهيار وإصلاح أو ترقية أو صيانة المنصة لدينا (مؤقت و / أو جزئي) أو غير ذلك)، معلومات غير دقيقة أو مضللة أو غير صحيحة أو عدم تسليم المعلومات. يبقى كل مقدم خدمات العانية بالبشرة والتجميل مسؤولاً في جميع الأوقات عن دقة واكتمال وصحة المعلومات (الوصفية) (بما في ذلك الأسعار / الرسوم والسياسات والشروط والتوافر) المعروضة على منصتنا. لا تشكل المنصة الخاصة بنا ولا ينبغي اعتبارها توصية أو تأييداً لمدى جودة أو مستوى الخدمة أو مؤهلاً أو تصنيفاً (نجوم) لأي مقدم خدمات العانية بالبشرة والتجميل متوفر (أو مرافقه أو مكانه أو مركباته أو منتجاته (الرئيسية أو الإضافية) أو خدماته) باستثناء ما هو مبين بصراحة أو منصوص عليه خلاف ذلك.</strong></p>\r\n\r\n<p><strong>خدمات العانية بالبشرة والتجميل متوفرة للاستخدام الشخصي وغير التجاري فقط. ولذلك، لا يسمح لكم بإعادة بيع أو تعميق الارتباط أو استخدام أو نسخ أو رصد (على سبيل المثال استخدام العنكبوت أو السكراب) أو عرض أو تنزيل أو إعادة إنتاج أي محتوى أو معلومات أو برمجيات أو حجوزات أو تذاكر أو خدمات أو منتجات متوفرة على منصتنا، لأي نشاط أو غرض تجاري أو تنافسي.</strong></p>\r\n\r\n<p><strong>2.&nbsp;</strong>الأسعار، والأسعار المشطوبة، ومضاهاة الأسعار</p>\r\n\r\n<p><strong>الأسعار كما تُقدم لنا من مقدمي خدمات العانية بالبشرة والتجميل على منصتنا هي تنافسية جداً. جميع الأسعار لقاء خدمتك، ويتم عرض كل الأسعار غير متضمّنة ضريبة القيمة المضافة\\ضريبة البيع والضرائب الأخرى (الضرائب قابلة للتغيير) والرسوم، ما لم يرد ذلك بشكل مختلف على منصتنا أو في رسالة تأكيد الحجز المرسلة عبر البريد الإلكتروني أو في التذكرة. أسعار التذاكر تكون للشخص الواحد أو للمجموعة ويخضع ذلك للصلاحية أو تاريخ الانتهاء التي تكون مذكورة على التذكرة ذاتها عندما ينطبق الأمر. الرسوم والضرائب المطبقة (بما في ذلك ضريبة القيمة المضافة) او أي رسوم أخرى يراها مقدم الخدمة أو الموقع قد يتم خصمها من قبل مقدم الرحلات في حال وجود رسوم عدم الحضور أو الإلغاء.</strong></p>\r\n\r\n<p><strong>أحياناً تتوفر أسعار أرخص على منصتنا لعرض معين أو لخدمة أو منتجع معين. ولكن هذه الأسعار التي يدلي بها مقدمو خدمات العانية بالبشرة والتجميل تحمل قيوداً وشروطاً خاصة، مثلاً غير قابل للإلغاء أو غير قابل للاسترداد. يرجى التحقق من شروط الخدمة و الحجز المتعلقة لأخذ العلم بهذه الشروط قبل إجراء الحجز.</strong></p>\r\n\r\n<p><strong>نريد لكم أن تدفعوا أقل سعر ممكن للخدمة أو المنتج الذي تحصلون عليه. لدى عثوركم على الخدمة أو المنتج الذي تحجزونه على المنصة مع شروط الخدمة نفسها.</strong></p>\r\n\r\n<p><strong>محوّل العملات سوف نسعى إلى توفيره للعلم فقط ولا ينبغي الاعتماد عليه كأداة دقيقة ولحظية؛ الأسعار الفعلية قد تختلف.</strong></p>\r\n\r\n<p><strong>الأخطاء الواضحة غير ملزمة (بما في ذلك أخطاء الطباعة).</strong></p>\r\n\r\n<p><strong>يتم وضع علامة على جميع العروض الخاصة والعروض الترويجية. إذا لم يتم تصنيفها بعلامة، لا يمكنك استخلاص أي حقوق في حالة وجود أغلاط أو أخطاء واضحة.</strong></p>\r\n\r\n<p><strong>3.&nbsp;</strong>الخصوصية وملفات تعريف الارتباط</p>\r\n\r\n<p><a href=\"http://saaloon.com/saaloon.com\">saaloon.com</a><strong>&nbsp;تحترم خصوصيتك. يرجى إلقاء نظرة على ما يخصنا من&nbsp;سياسة الخصوصية وملفات تعريف الارتباط&nbsp;للمزيد من المعلومات.</strong></p>\r\n\r\n<p><strong>4.&nbsp;مجاناً للمستهلكين، مقدمي الرحلات&nbsp;خدمات العانية بالبشرة والتجميل&nbsp;من يتكفلون بالدفع فقط.</strong></p>\r\n\r\n<p><strong>خدمتنا مجانية للمستهلكين ما لم يذكر خلاف ذلك لأنه على عكس العديد من الأطراف الأخرى، فنحن لن نقوم بتحصيل أية مبالغ منك مقابل خدمات خدمات العانية بالبشرة والتجميل الخاصة بنا أو نقوم بإضافة أية رسوم (حجز) إضافية على سعر الخدمة. سوف تدفع لمقدم خدمات العانية بالبشرة والتجميل المبلغ المعني كما هو مبين في حجز الخدمة (بالإضافة إلى الضرائب المطبقة ذات الصلة والرسوم (إن وجدت) والتي هي غير مدرجة في السعر حتى الآن).</strong></p>\r\n\r\n<p><strong>يدفع مقدمو خدمات العانية بالبشرة والتجميل عمولة (على شكل نسبة صغيرة من سعر المنتج (مثلاً سعر الميكب) لصالح&nbsp;</strong><a href=\"http://saaloon.com/saaloon.com\">saaloon.com</a><strong>&nbsp;بعد أن يقوم المستفيد النهائي باستهلاك الخدمة أو المنتج الذي يقدمه مقدم الخدمة (على سبيل المثال بعد انتهاء السيدة من الخدمة (والدفع) في مكان الخدمة وهو المشغل او الصالون.</strong></p>\r\n\r\n<p><strong>&nbsp;يمكن لمقدمي خدمات العانية بالبشرة والتجميل تحسين ترتيبهم من خلال زيادة عمولاتهم (معزز الحضور). يعتمد استخدام المعزز (زيادة العمولة للحصول على ترتيب أفضل) على تقدير مقدم الخدمة من وقت لآخر، ومن منتج لمنتج آخر معروض. عند تحديد الترتيب الافتراضي ستأخذ اللوغاريتمات في عين الاعتبار زيادة في العمولة عند تحديد الترتيب التلقائي. يدفع الشركاء المفضلون عمولة أعلى مقابل وضع أفضل في الترتيب.</strong></p>\r\n\r\n<p><strong>سيتم إتاحة مقدمي الخدمات الذين لديهم علاقة تجارية مع&nbsp;</strong><a href=\"http://saaloon.com/saaloon.com\">saaloon.com</a><strong>&nbsp;(من خلال اتفاقية) فقط على المنصة (للترويج عن منتجاتهم في حال كانت&nbsp;</strong>B2B<strong>&nbsp;و / أو&nbsp;</strong>B2C) .&nbsp;<a href=\"http://saaloon.com/saaloon.com\">saaloon.com</a><strong>&nbsp;كما انها &nbsp;منصة مفتوحة (مثل أمازون أو موقع إي باي) حيث يمكن للمستخدمين النهائيين إتاحة منتجاتهم وتوفيرها على الموقع (منصة&nbsp;</strong>C2C<strong>).</strong></p>\r\n\r\n<p><strong>يسمح&nbsp;</strong><a href=\"http://saaloon.com/saaloon.com\">saaloon.com</a><strong>&nbsp;للأطراف غير المهنية بعرض منتجاته أو بيعه على&nbsp;</strong><a href=\"http://saaloon.com/saaloon.com\">saaloon.com</a><strong>&nbsp;أو من خلاله.</strong></p>\r\n\r\n<p><strong>5.&nbsp;</strong>بطاقة الائتمان أو التحويل البنكي</p>\r\n\r\n<p><strong>عندما يكون الخيار متوفراً وقابلاً للتطبيق، يقوم مقدمو خدمات العانية بالبشرة والتجميل محددون بتقديم فرصة دفع حجوزات الرحلات (بشكل كامل أو جزئي وكما هو محدد وفقاً لسياسة الدفع لدى مقدم خدمات العانية بالبشرة والتجميل) للمقدم خلال عملية الحجز عبر وسائل الدفع الآمنة على الإنترنت (وكل ذلك وفقاً لما يقدمه ويدعمه البنك الخاص بك). يقوم&nbsp;</strong><a href=\"http://saaloon.com/saaloon.com\">saaloon.com</a><strong>&nbsp;بالتعامل مع الدفعات لخدمات ومنتجات محددة (عبر معالجات دفعات من طرف ثالث) (وذلك يعني خدمة التعامل مع الدفعات) تحت خيار مقدم الرحلة (لن يتصرف&nbsp;</strong><a href=\"http://saaloon.com/saaloon.com\">saaloon.com</a><strong>&nbsp;كتاجر سجلات في أي حالة من الحالات على الإطلاق).</strong></p>\r\n\r\n<p><strong>سيتم معالجة الدفعة بشكل آمن من بطاقتك الائتمانية أو بطاقة الخصم لحساب مقدم مقدم خدمات العانية بالبشرة والتجميل عبر معالج دفعات من طرف ثالث. وأي دفعه يتم التعامل معها لصالح مقدم مقدم خدمات العانية بالبشرة والتجميل بهذه الطريقة تمثل في كل حالة دفعة عن قيمة الحجز(أو جزء من القيمة) من طرفك للخدمة أو المنتج المحدد في الدفعة النهائية (تحرير الدفع) لمثل هذه الأسعار (أو جزء منها) والتي تكون مستحقة للدفع، ولا يحق لك استرداد هذه المبالغ المدفوعة.</strong></p>\r\n\r\n<p><strong>للحصول على أسعار معينة (غير قابلة للاسترداد) أو عروض خاصة، يرجى ملاحظة أنه قد يتطلب الدفع إلى المقدمين عن طريق التحويل البنكي (إن وجد) أو عن طريق بطاقتكم الائتمانية، ولذلك قد تحصل على تفويض مسبق أو يتم الحسم منها (أحياناً دون إمكانية الاسترداد) عند إجراء حجز الخدمة. يرجى التحقق من تفاصيل (الحجز) لمنتجك أو خدمتك التي اخترتها بشكل تفصيلي لمعرفة أي من هذه الشروط قبل إجراء حجز رحلتك. لا يمكنك تحميل&nbsp;</strong><a href=\"http://saaloon.com/saaloon.com\">saaloon.com</a><strong>&nbsp;المسؤولية عن أي عملية خصم (مصرح بها، (مزعومة) أو غير مصرح بها أو خاطئة) من قبل مقدم الرحلة ولا يمكن تحصيل أو إعادة تحصيل أي قيمة لأي عملية خصم مصرح بها وصحيحة من قبل مقدم الرحلة (بما في ذلك الأسعار مسبقة الدفع، ورسوم عدم الحضور وحالات الإلغاء ذات التكلفة) على بطاقتك الائتمانية.</strong></p>\r\n\r\n<p><strong>في حال حصول احتيال أو استخدام غير مصرح به لبطاقتكم الائتمانية من قبل أطراف ثالثة، فإن معظم البنوك وشركات بطاقات الائتمان تتحمل المخاطر، وتغطي جميع المترتبات الناتجة عن مثل هذا الاحتيال أو سوء الاستخدام. وقد يكون ذلك في بعض الأحيان خاضعاً لمستحقات (عادة مجموعه 50 يورو (أو ما يعادله بعملتكم المحلية)). في حال قامت شركة بطاقتكم الائتمانية أو مصرفكم باحتساب تلك المستحقات عليكم وخصمها منكم بسبب معاملات غير مصرح بها ناجمة عن حجز تم على منصتنا، فإننا لسنا ملزمين ندفع لكم هذا الخصم، ما يصل إلى مبلغ إجمالي قدره 50 يورو (أو ما يعادله بعملتكم المحلية). من أجل التعويض لكم، يرجى التأكد من إرسال تقرير الاحتيال إلى مزود بطاقتكم الائتمانية (وفقاً لقواعده وإجراءاته الخاصة بتقديم التقارير)، والاتصال بنا فوراً عن طريق البريد الإلكتروني. يرجى كتابة &quot;عملية احتيال على البطاقة الائتمانية&quot; في عنوان الرسالة الإلكترونية وأرسل لنا دليلاً عن خصم المبلغ (مثلاً: سياسة مزود البطاقة الائتمانية).</strong></p>\r\n\r\n<p><strong>6.&nbsp;</strong>الدفعة المسبقة، والإلغاء، وعدم الحضور، والشروط المفصلة</p>\r\n\r\n<p><strong>عند إجراء حجز الخدمة عن طريق مقدم خدمات العانية بالبشرة والتجميل، أنت تقبل وتوافق على سياسة الإلغاء وعدم الحضور ذات الصلة الخاصة بهذا المقدم، وعلى أية شروط وأح